import React from 'react';
import './App.css';

function App() {
  return (
    <div className="container">
      <h1>Page Title</h1>
      <p>In hac habitasse platea dictumst. Donec convallis finibus elit, tincidunt elementum elit sollicitudin quis.</p>
      <ul>
        <li>Lorem</li>
        <li>Ipsum</li>
        <li>Dolor</li>
        <li>More lorem</li>
        <li>Some other ipsum</li>
      </ul>
    </div>
  );
}

<div class="footer">
  <p>This is the footer</p>
</div>

export default App;
